import { Button, Col, Divider, Row } from 'antd'
import React, { useState, useEffect } from 'react'
import { RealtimeData_Request } from '../../api'
import { C3Model, G2Model } from '../../DataRequest/DataModel'
import { DataSortRT, GraphDataFind } from '../../DataRequest/RealTimeRequestWrap'
import HMIWrapper from '../Realtime/HMIWrapper'
import RealTimeGraphWrapper from '../Realtime/RealTimeGraphWrapper'
import RealTimeTableWrapper from '../Realtime/RealTimeTableWrapper'
import PolymerC3 from './HMI/PolymerC3'
import PolymerG2 from './HMI/PolymerG2'
import { Line } from '@antv/g2plot';

let C3DataModel = C3Model
let G2DataModel = G2Model
let BlankPage, GraphC3, GraphG2, OptionSelected = []

let RealTimeValue = {
    "C3HMI": C3DataModel,
    "G2HMI": G2DataModel,
    "C3Table": [],
    "G2Table": [],
    "C3Graph": [],
    "G2Graph": [],

}



const Line1RT = () => {

    const [Refresh, setRefresh] = useState(false)
    const [Graph, setGraph] = useState([])
    const [LabelSelect, setLabelSelect] = useState([])

    const [state, setState] = useState({ count: 0, count2: 100 });  

    // const setCount = useCallback(() => {
    //     setState(({count}) => ({ count: count + 1 }));
    //     setState(({count2}) => ({ count2: count + 1 }));
    //     setState(({count}) => ({ count2: count + 1 }));
    //   }, []);

    const DataRequest = async (label, site, page, line, HMIName, TableName) => {
        const response = await RealtimeData_Request(label, site, page, line)
        RealTimeValue[TableName] = DataSortRT(response)
        RealTimeValue[HMIName] = RealTimeValue[TableName]
    }

    const OptionCallBack = (Selected) => {
        OptionSelected = Selected
        console.log(OptionSelected);
    }

    const ClearHistoryCallBack = () => {
        setGraph(...[])
    }

    const RenderNewData = () => {
        
        DataRequest([], 'Polymerlink', '1', 'C3', 'C3HMI', "C3Table")
        DataRequest([], 'Polymerlink', BlankPage, 'G2', 'G2HMI', "G2Table")

        RealTimeValue['C3Graph'] = GraphDataFind(OptionSelected, RealTimeValue['C3Table'])


        if (RealTimeValue['C3Graph'].length === 0) {
            console.log('Undefine data');
        }

        else {
            RealTimeValue['C3Graph'].forEach(element => {
                Graph.push(element)
            });
            GraphC3.changeData(Graph)
        }

        setState(({count}) => ({ count: count + 1 }));
    }


    useEffect(() => {

        GraphC3 = new Line('GraphC3', {
            data: Graph,
            xField: 'time',
            yField: 'Value',
            seriesField: 'Label',
        });
        GraphC3.render();
        RenderNewData()


        console.log('Effect');

        const interval = setInterval(() => {
            RenderNewData()
            console.log('inter')
        }, 3000)

        return () => {
            clearInterval(interval)
            console.log('Unmount Effect Line1RT');
            GraphC3.destroy();
        }

        // GraphG2 = new Line('GraphG2', {
        //     data: RealTimeValue['G2Graph'],
        //     xField: 'time',
        //     yField: 'Value',
        //     seriesField: 'Label',
        // });
        // GraphG2.render();

    }, [])


    return (
        <div>
            {console.log('render')}
            <Button onClick={RenderNewData}> Test R</Button>

            <HMIWrapper Tab={['C3', 'G2']}>
                <PolymerC3 key={'C3'} Parameter={RealTimeValue['C3HMI']} />
                <PolymerG2 key={'G2'} Parameter={RealTimeValue['G2HMI']} />
            </HMIWrapper>

            <Divider orientation="left">Parameter List</Divider>

            <div>
                <Row gutter={[16, 16]}>
                    <Col span={12} xs={24} xl={12}>
                        <RealTimeTableWrapper TableTitle={'C3'} TableData={RealTimeValue['C3Table']} />
                    </Col>
                    <Col span={12} xs={24} xl={12}>
                        <RealTimeTableWrapper TableTitle={'G2'} TableData={RealTimeValue['G2Table']} />
                    </Col>

                </Row>
            </div>

            <div>
                <Row gutter={[16, 16]}>

                    <Col span={12} xs={24} xl={12}>
                        <RealTimeGraphWrapper GraphData={Graph} GarphTitle={'C3'}
                            DataModel={C3DataModel}
                            OptionCallBack={OptionCallBack}
                            ClearHistoryCallBack={ClearHistoryCallBack}
                        >
                            <div id='GraphC3'></div>
                        </RealTimeGraphWrapper>
                    </Col>
                    {/* 
                    <Col span={12} xs={24} xl={12}>
                        <RealTimeGraphWrapper GraphData={RealTimeValue['C3Graph']} GarphTitle={'C3'}>
                            <div id='GraphG2'></div>
                        </RealTimeGraphWrapper>
                    </Col> */}

                </Row>
            </div>


        </div>
    )
}

export default Line1RT
